function I = fcnK6M(S, T, u, alpha, F, tol)
t1 = F .^ 2;t3 = sqrt(t1 + u);t4 = 0.1e1 ./ t3;t7 = log(F + t3);t9 = 0.1e1 ./ u;t13 = alpha .^ 2;t14 = -alpha + u;t15 = 0.1e1 ./ t14;t16 = t15 .* t13;t17 = sqrt(-alpha);t18 = F - t17;t19 = 0.1e1 ./ t18;t20 = t18 .^ 2;t21 = t18 .* t17;t24 = sqrt(t20 + 0.2e1 .* t21 - alpha + u);t25 = 0.1e1 ./ t24;t29 = t17 .* t13;t30 = t14 .^ 2;t31 = 0.1e1 ./ t30;t36 = t31 .* t13 .* alpha;t37 = t9 .* F;t38 = t25 .* t37;t41 = sqrt(t14);t43 = 0.1e1 ./ t41 ./ t30;t47 = log(0.2e1 .* t19 .* (t24 .* t41 - alpha + t21 + u));t53 = F + t17;t54 = 0.1e1 ./ t53;t55 = t53 .^ 2;t56 = t53 .* t17;t59 = sqrt(t55 - 0.2e1 .* t56 - alpha + u);t60 = 0.1e1 ./ t59;t67 = t60 .* t37;t73 = log(0.2e1 .* t54 .* (t59 .* t41 - alpha - t56 + u));t80 = 0.1e1 ./ t17 .* t13;t85 = 0.1e1 ./ t41 ./ t14;t95 = -t4 .* F + t7 - 0.2e1 .* t4 .* t9 .* alpha .* F - t25 .* t19 .* t16 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t25 .* t31 .* t29 - 0.3e1 ./ 0.4e1 .* t38 .* t36 + 0.3e1 ./ 0.4e1 .* t47 .* t43 .* t29 - 0.7e1 ./ 0.4e1 .* t38 .* t16 - t60 .* t54 .* t16 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t60 .* t31 .* t29 - 0.3e1 ./ 0.4e1 .* t67 .* t36 - 0.3e1 ./ 0.4e1 .* t73 .* t43 .* t29 - 0.7e1 ./ 0.4e1 .* t67 .* t16 + 0.5e1 ./ 0.4e1 .* t25 .* t15 .* t80 - 0.5e1 ./ 0.4e1 .* t47 .* t85 .* t80 - 0.5e1 ./ 0.4e1 .* t60 .* t15 .* t80 + 0.5e1 ./ 0.4e1 .* t73 .* t85 .* t80;
